import axios from "axios";
import { useEffect, useState } from "react"
import { useNavigate, useParams } from "react-router-dom"

const URI ='http://localhost:8000/canchas/'

const CompEditCancha = () => {
    const [deportivoName, setDeportivoName] = useState('')
    const [canchaName, setCanchaName] = useState('')
    const [encargadoName, setEncargadoName] = useState('')
    const [encargadoPhone, setEncargadoPhone] = useState('')
    const [encargadoPosition, setEncargadoPosition] = useState('')
    const [encargadoRFC, setEncargadoRFC] = useState('')
    const [dirCalle, setDirCalle] = useState('')
    const [dirNumero, setDirNumero] = useState('')
    const [dirColonia, setDirColonia] = useState('')
    const [dirCP, setDirCP] = useState('')
    const [dirAlcaldia, setDirAlcaldia] = useState('')
    const [dirEntreCalles, setDirEntreCalles] = useState('')
    const [dirReferencias, setDirReferencias] = useState('')
    const [condicion, setCondicion] = useState('')
    const [coordinates, setCoordinates] = useState('')

    const navigate = useNavigate()
    const id = useParams() //se guarda como un objeto, por ello los corchetes

    //Procedimiento para actualizar
    const update = async (e) => {
        e.preventDefault()
        //en este caso pasamos la URI mas la id, justo como se hizo en las pruebas con thunderclient
        await axios.put(URI+id, {
            deportivoName: deportivoName, canchaName: canchaName, encargadoName: encargadoName,
                encargadoPhone: encargadoPhone, encargadoPosition: encargadoPosition, encargadoRFC: encargadoRFC,
                dirCalle: dirCalle, dirNumero: dirNumero, dirColonia: dirColonia, dirCP: dirCP, dirAlcaldia: dirAlcaldia,
                dirEntreCalles: dirEntreCalles, dirReferencias: dirReferencias, condicion:condicion, coordinates:coordinates        
            })
            navigate('/')
    }

    useEffect( () => {
        getCanchaById()
    },[])

    //Primero capturamos la informacion de la cancha desde la tabla y luego lo editamos
    const getCanchaById = async () => {
        const res = await axios.get(URI+id)
        try {
            console.log("Respuesta de la api", res.data)
            setDeportivoName(res.data.deportivoName)
            console.log("CanchaName", res.data.canchaName)
            setCanchaName(res.data.canchaName)
            setEncargadoName(res.data.encargadoName)
            setEncargadoPhone(res.data.encargadoPhone)
            setEncargadoPosition(res.data.encargadoPosition)
            setEncargadoRFC(res.data.encargadoRFC)
            setDirCalle(res.data.dirCalle)
            setDirNumero(res.data.dirNumero)
            setDirColonia(res.data.dirColonia)
            setDirCP(res.data.dirCP)
            setDirAlcaldia(res.data.dirAlcaldia)
            setDirEntreCalles(res.data.dirEntreCalles)
            setDirReferencias(res.data.dirReferencias)
            setCondicion(res.data.condicion)
            setCoordinates(res.data.coordinates)
            
        } catch (error) {
            console.log("Error al obtener datos", error)
        }
        
        console.log(`DeportivoName: ${res.data.deportivoName}`)
    }

    return(
            <div>
                <h1>Editar cancha existente</h1>
                <form onSubmit={update}>
                    <div className="mb-3">
                        <label className='form-label'>Nombre del Deportivo</label>
                        <input
                            value={deportivoName}
                            onChange={ (e) => setDeportivoName(e.target.value)}
                            type="text"
                            className="form-control"
                        />
                    </div>
                    <div className="mb-3">   
                    <label className='form-label'>Tipo de Cancha</label>             
                        <textarea
                            value={canchaName}
                            onChange={ (e) => setCanchaName(e.target.value)}
                            type="text"
                            className="form-control"
                        />                
                    </div>
                    <div className="mb-3">  
                    <h2>Informacion del encargado</h2>
                    <label className='form-label'>Nombre Completo</label>              
                        <textarea
                            value={encargadoName}
                            onChange={ (e) => setEncargadoName(e.target.value)}
                            type="text"
                            className="form-control"
                        />                
                    </div>
                    <div className="mb-3">  
                    <label className='form-label'>Teléfono</label>              
                        <textarea
                            value={encargadoPhone}
                            onChange={ (e) => setEncargadoPhone(e.target.value)}
                            type="text"
                            className="form-control"
                        />                
                    </div>
                    <div className="mb-3">   
                    <label className='form-label'>Posición</label>             
                        <input
                            value={encargadoPosition}
                            onChange={ (e) => setEncargadoPosition(e.target.value)}
                            type="text"
                            className="form-control"
                        />                
                    </div>
                    <div className="mb-3">  
                    <label className='form-label'>RFC</label>                              
                        <textarea
                            value={encargadoRFC}
                            onChange={ (e) => setEncargadoRFC(e.target.value)}
                            type="text"
                            className="form-control"
                        />                
                    </div>
                    <div className="mb-3"> 
                    <h2>Información de la ubicación de la cancha</h2>           
                    <label className='form-label'>Calle</label>               
                        <textarea
                            value={dirCalle}
                            onChange={ (e) => setDirCalle(e.target.value)}
                            type="text"
                            className="form-control"
                        />                
                    </div>    
                    <div className="mb-3">  
                    <label className='form-label'>Número</label>                  
                        <textarea
                            value={dirNumero}
                            onChange={ (e) => setDirNumero(e.target.value)}
                            type="text"
                            className="form-control"
                        />                
                    </div>     
                    <div className="mb-3"> 
                    <label className='form-label'>Colonia</label>                   
                        <textarea
                            value={dirColonia}
                            onChange={ (e) => setDirColonia(e.target.value)}
                            type="text"
                            className="form-control"
                        />                
                    </div>    
                    <div className="mb-3">       
                    <label className='form-label'>Código Postal</label>             
                        <textarea
                            value={dirCP}
                            onChange={ (e) => setDirCP(e.target.value)}
                            type="text"
                            className="form-control"
                        />                
                    </div>           
                    <div className="mb-3"> 
                    <label className='form-label'>Alcaldía</label>                   
                        <textarea
                            value={dirAlcaldia}
                            onChange={ (e) => setDirAlcaldia(e.target.value)}
                            type="text"
                            className="form-control"
                        />                
                    </div>           
                    <div className="mb-3">     
                    <label className='form-label'>Entre Calles</label>               
                        <textarea
                            value={dirEntreCalles}
                            onChange={ (e) => setDirEntreCalles(e.target.value)}
                            type="text"
                            className="form-control"
                        />                
                    </div>         
                    <div className="mb-3"> 
                    <label className='form-label'>Referencias</label>                   
                        <textarea
                            value={dirReferencias}
                            onChange={ (e) => setDirReferencias(e.target.value)}
                            type="text"
                            className="form-control"
                        />                
                    </div>         
                    <div className="mb-3">   
                    <label className='form-label'>Condición</label>                 
                        <textarea
                            value={condicion}
                            onChange={ (e) => setCondicion(e.target.value)}
                            type="text"
                            className="form-control"
                        />                
                    </div>    
                    <div className="mb-3">  
                    <label className='form-label'>Ubicación</label>                  
                        <textarea
                            value={coordinates}
                            onChange={ (e) => setCoordinates(e.target.value)}
                            type="text"
                            className="form-control"
                        />                
                    </div>  
                    <button type='submit' className="btn btn-primary">Ingresar</button>                                                                                                                                                     
                </form>
            </div>
        )
}


export default CompEditCancha
